import React from 'react';
import './Logo.css';

function Logo() {
  return (
    <div className="logo-container">
      <div className="logo">
        <svg width="120" height="120" viewBox="0 0 120 120" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M60 10L90 50H70L60 35L50 50H30L60 10Z" fill="white"/>
          <path d="M30 50L60 90L90 50H70L60 65L50 50H30Z" fill="white"/>
          <path d="M45 50L60 70L75 50H45Z" fill="#1a0b2e"/>
        </svg>
      </div>
    </div>
  );
}

export default Logo;
